// RENTHIVE/client/src/pages/Login/Login.jsx

import React, { useState } from 'react';
import axios from 'axios';
import './Login.css';
import RentHiveLogo from '../../assets/Log.png'; 
import LoginIllustration from '../../assets/Login_page.png'; 
import { FaFacebookF, FaGoogle, FaApple } from 'react-icons/fa'; 

const API_BASE_URL = 'http://localhost:5000/api/auth';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState(null); 
  const [showPassword, setShowPassword] = useState(false); // FOR PASSWORD TOGGLE

  const togglePasswordVisibility = () => {
    setShowPassword(prevShowPassword => !prevShowPassword);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);

    try {
        const response = await axios.post(`${API_BASE_URL}/login`, { 
            email, 
            password 
        });

        // Store the token and redirect
        localStorage.setItem('token', response.data.token);
        console.log('Login Success! Token:', response.data.token);
        // history.push('/dashboard'); // Uncomment and use react-router-dom for navigation

    } catch (err) {
        if (err.response && err.response.data && err.response.data.msg) {
            setError(err.response.data.msg);
        } else {
            setError('Login failed. Please try again.');
        }
    }
  };

  return (
    <div className="login-container">
      <div className="login-form-card">
        <img src={RentHiveLogo} alt="RentHive Logo" className="logo" />
        <h1 className="title">Login</h1>
        <p className="subtitle">Login to access your travelwise account</p>

        {error && <div style={{ color: 'red', marginBottom: '15px', fontSize: '14px' }}>{error}</div>}

        <form onSubmit={handleSubmit} className="login-form">
          {/* Email Input */}
          <label htmlFor="email">Email</label>
          <input 
            type="email" 
            id="email" 
            placeholder="john.doe@gmail.com"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />

          {/* Password Input */}
          <label htmlFor="password">Password</label>
          <div className="password-input-wrapper">
            <input 
              type={showPassword ? 'text' : 'password'} // TOGGLE LOGIC HERE
              id="password" 
              placeholder="............"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <span 
              className="password-toggle-icon"
              onClick={togglePasswordVisibility} // TOGGLE CLICK HANDLER HERE
            >
              {showPassword ? 'üôà' : 'üëÅÔ∏è'}
            </span> 
          </div>

          <div className="remember-forgot-row">
            <label className="checkbox-container">
              <input 
                type="checkbox" 
                checked={rememberMe}
                onChange={(e) => setRememberMe(e.target.checked)}
              />
              Remember me
            </label>
            {/* The Forgot Password link would open a modal or navigate to a ForgotPassword page */}
            <a href="/forgot-password" className="forgot-password">Forgot Password</a>
          </div>

          <button type="submit" className="login-button">Login</button>
        </form>

        <p className="signup-link">
          Don't have an account? <a href="/register">Sign up</a>
        </p>

        <div className="social-login-separator">Or login with</div>

        <div className="social-buttons">
          <button className="social-btn facebook"><FaFacebookF /> Facebook</button>
          <button className="social-btn google"><FaGoogle /> G</button>
          <button className="social-btn apple"><FaApple /> </button>
        </div>
      </div>

      <div className="login-illustration-side">
        <img src={LoginIllustration} alt="House and Keys" />
      </div>
    </div>
  );
};

export default Login;
